import React, {useEffect, useState} from 'react'
import './App.css';
import Header from './Components/Header';
import {Route, Routes} from "react-router-dom"

function App() {

    const [data, setData] = useState([{}])

    useEffect(() => {
        fetch("/users").then(
            res => res.json()
        ).then(
            data => {
                setData(data)
                console.log(data)
            }
        )
    }, [])
    return (
        <Routes>
            <Route path="/" element={<Header/>}/>
        </Routes>


    )

}

export default App
